  public static void split(int[] array) {
    int len = array.length;
    if (len == 1) {
      return;
    }
    int middle = len / 2;
    int[] larray = new int[middle];
    int[] rarray = new int[len - middle];
    int i = 0, j = 0;
    for (i = 0; i < len; i++) {
      if (i < middle) {
        larray[i] = array[i];
      } else {
        rarray[j] = array[i];
        j++;
      }
    }
    split(larray);
    split(rarray);
    merge(larray, rarray, array);
  }

  public static void merge(int[] larray, int[] rarray, int[] array) {
    int lsize = larray.length;
    int rsize = rarray.length;
    int i = 0, r = 0, l = 0;
    while (l < lsize && r < rsize) {
      if (larray[l] < rarray[r]) {
        array[i] = larray[l];
        l++;
        i++;
      } else {
        array[i] = rarray[r];
        r++;
        i++;
      }
    }
    while (l < lsize) {
      array[i] = larray[l];
      l++;
      i++;
    }
    while (r < rsize) {
      array[i] = rarray[r];
      r++;
      i++;
    }
  }
